import React from "react"
import { Link } from "react-router-dom";

export default function RegisterPage() {


    function registerClicked() {
        console.log("reG")
    }

    return (
        <div className="register-rect">
            <div className="register-title">Register</div>

            <input className="usernameReg-field" type="text" name="username" placeholder="Username" required/>
            <input className="passwordReg-field" type="password" name="password" placeholder="Password" required/>
            <input className="password-confirm" type="password" name="confirmPassword" placeholder="Confirm Password" required/>

            <div className="reg-btn" onClick={registerClicked}>Register</div>
        </div>
    )

    
}
